CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_mud_count_Page_Wise`(IN numUserId int, IN searchText varchar(500))
BEGIN
	select 
    count(mud.id) 'count_data',
    row_number() over(order by mud.id asc) as RowNum,
    mud.id as id,
    mudNo, 
    year,
    date(seizeDate) as sDate, 
    users.name as updator, 
    department.name as departmentName, 
    head.name as headName, 
    status.name as statusName, 
    courtname.name as courtName ,
    ioname,
    location,
    caseDecided,
    dateDecision,
    dateOrderDestroy,
    dateDestroy
    from mud 
    left outer join department on department.id = mud.departmentId 
    left outer join head on head.id = mud.headId 
    left outer join courtname on courtname.id = mud.courtId 
    left outer join status on status.id = mud.statusId 
    left outer join users on users.id = mud.updatedBy 
    where mud.isActive = 1
    and department.id in (select departmentId from user_department_map where userId = numUserId)
    and (mudNo rlike (CASE searchText WHEN '' THEN mudNo ELSE searchText END) 
		OR firNo rlike (CASE searchText WHEN '' THEN FirNo ELSE searchText END));
END ;;
